import React from 'react';
import styled from 'styled-components';
import ArrowIcon from './ArrowIcon';

const LogoContainer = styled.div`
  display: flex;
  align-items: center;
  gap: ${props => props.theme.spacing.sm};
  cursor: pointer;
  transition: ${props => props.theme.transitions.base};

  &:hover {
    transform: scale(1.05);
  }
`;

const LogoIcon = styled.div`
  width: ${props => props.size === 'large' ? '48px' : props.size === 'medium' ? '36px' : '28px'};
  height: ${props => props.size === 'large' ? '48px' : props.size === 'medium' ? '36px' : '28px'};
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const LogoText = styled.span`
  font-family: ${props => props.theme.fonts.primary};
  font-weight: ${props => props.theme.fontWeights.bold};
  font-size: ${props => props.size === 'large' ? props.theme.fontSizes['2xl'] : 
                        props.size === 'medium' ? props.theme.fontSizes.xl : 
                        props.theme.fontSizes.lg};
  background: ${props => props.theme.colors.gradientPrimary};
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  letter-spacing: -0.02em;
`;

const LokanexLogo = ({ size = 'medium', showText = true, ...props }) => {
  return (
    <LogoContainer {...props}>
      <LogoIcon size={size}>
        <svg
          width="100%"
          height="100%"
          viewBox="0 0 100 100"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          {/* Glow effect */}
          <filter id="glow">
            <feGaussianBlur stdDeviation="3" result="coloredBlur"/>
            <feMerge> 
              <feMergeNode in="coloredBlur"/>
              <feMergeNode in="SourceGraphic"/>
            </feMerge>
          </filter>

          {/* Shadow */}
          <path
            d="M25 65 L25 45 L45 45 L45 25 L75 50 L45 75 L45 55 L25 55 Z"
            fill="rgba(0, 0, 0, 0.2)"
            transform="translate(2, 2)"
          />

          {/* Main arrow shape - L base */}
          <path
            d="M25 60 L25 40 L40 40 L40 25 L70 50 L40 75 L40 50 L25 50 Z"
            fill="url(#arrowGradient)"
            filter="url(#glow)"
          />

          {/* Arrow head highlight */}
          <path
            d="M40 30 L65 50 L40 70 L40 50 Z"
            fill="url(#highlightGradient)"
            opacity="0.8"
          />

          {/* Inner curve for 3D effect */}
          <path
            d="M30 45 Q35 50 30 55"
            stroke="url(#innerCurve)"
            strokeWidth="2"
            fill="none"
            opacity="0.6"
          />

          {/* Top surface highlight */}
          <path
            d="M25 40 L40 40 L40 30 L65 50 L40 70 L40 60 L25 60 Z"
            fill="url(#topHighlight)"
            opacity="0.3"
          />

          {/* Gradients */}
          <defs>
            <linearGradient id="arrowGradient" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#00bfff" />
              <stop offset="30%" stopColor="#0099ff" />
              <stop offset="70%" stopColor="#0066cc" />
              <stop offset="100%" stopColor="#004499" />
            </linearGradient>
            <linearGradient id="highlightGradient" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#66d9ff" />
              <stop offset="50%" stopColor="#00bfff" />
              <stop offset="100%" stopColor="#0099ff" />
            </linearGradient>
            <linearGradient id="innerCurve" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#33ccff" />
              <stop offset="100%" stopColor="#0066cc" />
            </linearGradient>
            <linearGradient id="topHighlight" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#ffffff" />
              <stop offset="100%" stopColor="#66d9ff" />
            </linearGradient>
          </defs>
        </svg>
      </LogoIcon>
      {showText && <LogoText size={size}>Lokanex</LogoText>}
    </LogoContainer>
  );
};

export default LokanexLogo;
